import React, { Component } from 'react';
import './App.css';

class App extends Component {
  render() {
    return (
      <div className="App">
        <header className="App-header">
          <h1>List of Illnesses</h1>
          <ul>
            <li>Common cold</li>
          </ul>
        </header>
      </div>
    );
  }
}

export default App;
